import React from "react";
import contactimg from "./contact-img.jpg";


import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import CakeIcon from '@mui/icons-material/Cake';
import SchoolIcon from '@mui/icons-material/School';
import Details from "./ListWorks";
import EmailIcon from '@mui/icons-material/Email';
// import WorkIcon from '@mui/icons-material/Work';
// import BeachAccessIcon from '@mui/icons-material/BeachAccess';

function Contact() {

    const imgColor = {
        "-webkit-filter": "grayscale(100%)", /* Safari 6.0 - 9.0 */
        "filter": "grayscale(100%)",
        width: "50%",
        display: "block",
        "margin-left": "auto",
        "margin-right": "auto"

    }

    const cdetails = {
        "text-align": "center"
    }

    return (
        <div>
            <img src={contactimg} alt="" style={imgColor} />

            <div id="contactPage">

                <div style={cdetails}>
                    <h3 className="cName"> Purushothaman G </h3>
                    <p> WEB | FLUTTER | PYTHON </p>
                </div>


                <div className="middleContact">

                    <div>
                        <h5> Personal </h5>
                    </div>

                    <List className="detailsList" sx={{ width: '100%', maxWidth: 500, bgcolor: 'background.paper' }}>

                        <Details icon={<CakeIcon />} title="16 March 2002" />
                        <Details icon={<SchoolIcon />} title="Student" />
                        <Details icon={<EmailIcon/>} title="officialpurushothaman@gmail.com" />

                    </List>

                </div>

            </div>

        </div>
    )


}

export default Contact;
